        <Modal>
            <div className="container-slider">
                {dataSlider.map((obj,index)=>{
                    return (
                        <div>
                            <img alt="some" src={`../../../../../images/image-product-${index + 1}.jpg`}/>

                        </div>
                    )
                    })}

            </div>
        </Modal>
    )


}

export default Slider
